        SET v_ad_tag_id_max = v_ad_tag_id_max + 1;
        INSERT INTO AD_TAG_TBL(id, ad_id, tag_id, created_at, updated_at) VALUES(v_ad_tag_id_max, v_ad_id_max, v_tag_id_max, now(), now());
    END IF;
    -- end ad record
END;
